import './ExerciseList.scss';
import Exercise from './Exercise';
import React, { useState } from "react";




function ExerciseList() {

  const [data, setData] = useState([]);

  const getData = async () => {
    const result = await fetch('http://localhost:3000/workouts');
    const data = await result.json();
    console.log(data);
    setData(data);
  }

  let WorkoutData = data.map(item =>
    <Exercise 
      id={ item.id } 
      name={ item.name } 
      type={ item.type } 
      timing={ item.timing } 
      target={ item.target } 
    />
  );

  return (
    <div className="ExerciseList">
            <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Type</th>
            <th>Timing</th>
            <th>Target Area</th>
          </tr>
        </thead>
        <tbody>
          { WorkoutData }
        </tbody>
        </table>

        <button>Add Exercise</button>
    </div>
  );
}

export default ExerciseList;
